 This is an example of a closure, where the inner function returned by createHelloWorld "remembers" the environment in which it was created,
 including any variables or functions that were in scope at that time.

The use of rest parameter syntax (...args) in the inner function allows for any number of arguments to be passed to the function, but they are ignored and not used in the returned string.

