# Intuition
The purpose of this code is to create a higher-order function that generates a specific function, which in this case is a function that always returns $$"Hello \space World"$$. The outer function $$createHelloWorld()$$ is a factory function that generates the inner function. The use case of this pattern is to abstract away the details of creating the inner function and provide a simple interface to the user of the factory function.

# Approach
The approach here is to use a closure to create a function that has access to the $$ans$$ variable defined in the outer function's scope. The inner function is defined using the $$ES6$$ spread operator to capture any arguments passed to it (even though the function doesn't actually use them). The inner function then returns the string $$"Hello\space World"$$ that was defined in the outer function's scope.

# Complexity
- Time complexity:
The time complexity of this code is constant time, $$O(1)$$, because the inner function always returns the same value, $$"Hello \space World"$$, regardless of the input arguments.

- Space complexity:
The space complexity of this code is also constant time, $$O(1)$$, because the only variable used is ans which is stored in the outer function's scope, and there are no dynamic data structures used that would grow with input size.

# Code
```
/**
 * @return {Function}
 */
var createHelloWorld = function() {
    return function(...args) {
        //creating answer variable (type : string)
        var ans = "Hello World";
        //return ans
        return ans;
    }
};

/**
 * const f = createHelloWorld();
 * f(); // "Hello World"
 */
```
